query:
/*+ NoNestLoop(t mi_idx) NoNestLoop(mi_idx t mk) */ select count(*)
from title AS t
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND t.kind_id = 1 AND t.production_year < 2012 AND mi_idx.info_type_id < 100
inner join movie_keyword AS mk
on t.id = mk.movie_id AND mk.keyword_id < 3875;
